import RecipeView from "../../components/RecipeView";

const recipe = {
    name: "French Press",
    description: "test",
    steps: [
        {
            description: "Steep coffee in all of the water",
            duration: 240,
        },
        {
            description:
                "Stir, removing the floating grounds, and remove all foam during",
            duration: 300,
        },
    ],
};

const FrenchPressRecipe = () => <RecipeView recipe={recipe} />;

export default FrenchPressRecipe;
